const Effect = () => {
    let [state ,setState]=useState(0)
    console.log("re-render") 
    useEffect(()=>{
        document.title="you clicked"+ state+"times"
    },[state])

    setState(state)
  return (
    <div>
      <h2> how to use useEffect </h2>
      <h3>{state}</h3>
        <h4>jagadesh</h4> 
    </div>
  )
}

export default Effect
